import Head from 'next/head';
import Link from 'next/link';

import {useEffect, useState} from 'react';
import { Container, Row, Col} from 'reactstrap';
import useSWR from 'swr';
import * as Api from '../../redux/Api.js';


import { Phone } from '@styled-icons/material';

import DashboardLayout from "../../layouts/DashboardLayout";
import Titlebar from "../../components/Titlebar";
import UserComponent from "../../components/UserComponent";



export default function GroupList(props) {

	const { data, error } = useSWR('http://practxbestaging-env.eba-6m7puu5w.us-east-2.elasticbeanstalk.com/api/practices', Api.getPractice)

	if (error) return <div>failed to load</div>
	if (!data) return <div>loading...</div>


	return (


		<DashboardLayout>
			<React.Fragment>

				<Row>
					<Col>

						<Titlebar title="Group List" crumb={["Home", "Group", "Group list"]}/>

					</Col>
				</Row>


				<Row className={"mt-3"} sm="4">


					{ data.rows.map((practice)=><UserComponent />)}

				</Row>






			</React.Fragment>

		</DashboardLayout>

	)
}


export async function getServerSideProps(context) {
  return {
    props: {}, // will be passed to the page component as props
  }
}
